import React from 'react';
import styled from 'styled-components';



const item = styled.div`
    a{
        text-decoration: none;
    }    
`



class Link extends React.Component {
  render(){
    return (
        <item>
        <a href="#">{this.props.text}</a>
        </item>

    );
  }
}
export default Link;
